BEGIN -- Begin Procedure
DECLARE @ObjectTreeTmp Table ( [parent] int ,[child] int ,[level] int ,[AssociatedType] Varchar(100) ); DECLARE @parent int = 0; SELECT DISTINCT @parent=pallet_id FROM VW_Gateway_Pallet_ShipmentAssociation WHERE [shipmentId]= @ShipmentId; --select @parent; WITH cte AS ( select null parent, @parent child, 0 as level,'Pallet' as AssociatedType union SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , 1 as level,a.[AssociatedType] FROM Shipping_Association a WHERE a.[Object_Beac_Id] = @parent UNION ALL SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , c.level + 1,a.[AssociatedType] FROM Shipping_Association a JOIN cte c ON a.[Object_Beac_Id] = c.child ) INSERT into @ObjectTreeTmp SELECT distinct parent, child , level,AssociatedType FROM cte ORDER by level, parent;
SELECT tmp.child as Id,bec.[ObjectId],tmp.AssociatedType as [Type] ,tmp.parent, tmp.[level] FROM @ObjectTreeTmp tmp INNER JOIN Beacon_Object_Info bec ON tmp.child=bec.[Beacon_Obj_Id] ORDER by tmp.level, tmp.parent;
END --End Procedure

CREATE PROCEDURE  Sp_GetAssociation

@ShipmentId varchar(100)
 AS

BEGIN
DECLARE @parent int = 0; --DECLARE @MacId varchar(100)='2345673' DECLARE @ObjectTreeTmp Table ( [parent] int ,[child] int ,[level] int ,[AssociatedType] Varchar(100) );
SELECT DISTINCT @parent=pallet_id FROM VW_Gateway_Pallet_ShipmentAssociation WHERE [MacId]=@MacId; --select @parent; WITH cte AS ( select null parent, @parent child, 0 as level,'Pallet' as AssociatedType union SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , 1 as level,a.[AssociatedType] FROM Shipping_Association a WHERE a.[Object_Beac_Id] = @parent UNION ALL SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , c.level + 1,a.[AssociatedType] FROM Shipping_Association a JOIN cte c ON a.[Object_Beac_Id] = c.child ) INSERT into @ObjectTreeTmp SELECT distinct parent, child , level,AssociatedType FROM cte ORDER by level, parent;
SELECT [BeaconId],[TemperatureUpperLimit],[TemperatureLowerLimit],[HumidityUpperLimit],[HumidityLowerLimit] FROM Beacon_Object_Info WHERE [Beacon_Obj_Id] in (select child from @ObjectTreeTmp)
END

CREATE PROCEDURE [dbo].[Sp_GetBeacons]
 
 @MacId varchar(100)

 AS

BEGIN
DECLARE @parent int = 0; --DECLARE @MacId varchar(100)='2345673' DECLARE @ObjectTreeTmp Table ( [parent] int ,[child] int ,[level] int ,[AssociatedType] Varchar(100) );
SELECT DISTINCT @parent=pallet_id FROM VW_Gateway_Pallet_ShipmentAssociation WHERE [MacId]=@MacId; --select @parent; WITH cte AS ( select null parent, @parent child, 0 as level,'Pallet' as AssociatedType union SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , 1 as level,a.[AssociatedType] FROM Shipping_Association a WHERE a.[Object_Beac_Id] = @parent UNION ALL SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , c.level + 1,a.[AssociatedType] FROM Shipping_Association a JOIN cte c ON a.[Object_Beac_Id] = c.child ) INSERT into @ObjectTreeTmp SELECT distinct parent, child , level,AssociatedType FROM cte ORDER by level, parent;
SET @jsonOutput = (SELECT [BeaconId],[ObjectId],[ObjectType],[TemperatureUpperLimit],[TemperatureLowerLimit],[HumidityUpperLimit],[HumidityLowerLimit] FROM Beacon_Object_Info WHERE [Beacon_Obj_Id] in (select child from @ObjectTreeTmp) --FOR JSON PATH, WITHOUT_ARRAY_WRAPPER FOR JSON AUTO, Root('Beacons'))
END

CREATE PROCEDURE Sp_GetBeacons_Json(
 
 @MacId varchar(100),
 @jsonOutput NVARCHAR(MAX) OUTPUT
 )
 AS

BEGIN -- Begin Procedure DECLARE @TmpParentId Table ( [Object_Beac_Id] int ,[ObjectType] varchar(100) ,[Processed] tinyint
); DECLARE @ObjectTreeTmp Table ( [parent] int ,[child] int ,[level] int ,[AssociatedType] Varchar(100) ); DECLARE @ParentObjectType varchar(100); DECLARE @parent int;
INSERT INTO @TmpParentId SELECT DISTINCT[Object_Beac_Id],[ObjectType],0 FROM [dbo].[Shipping_Association] where [ShipMasterID]=@ShipmasterId and ObjectType=@ObjectType --select * from @TmpParentId -----Process WHILE (SELECT Count(*) From @TmpParentId Where Processed = 0 ) > 0 BEGIN -----Loop Starts SELECT TOP 1 @parent = Object_Beac_Id, @ParentObjectType=ObjectType FROM @TmpParentId Where Processed = 0 ;
WITH cte AS ( select null parent, @parent child, 0 as level,@ParentObjectType as AssociatedType union SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , 1 as level,a.[AssociatedType] FROM Shipping_Association a WHERE a.[Object_Beac_Id] = @parent UNION ALL SELECT a.[Object_Beac_Id], a.[Associated_Object_Id] , c.level + 1,a.[AssociatedType] FROM Shipping_Association a JOIN cte c ON a.[Object_Beac_Id] = c.child ) INSERT into @ObjectTreeTmp SELECT distinct parent, child , level,AssociatedType FROM cte ORDER by level, parent;
UPDATE @TmpParentId Set Processed = 1 Where Object_Beac_Id=@parent --Set Processed = 1 END -----Loop Ends
SELECT tmp.child as Id,bec.[ObjectId],tmp.AssociatedType as [Type] ,tmp.parent, tmp.[level] FROM @ObjectTreeTmp tmp INNER JOIN Beacon_Object_Info bec ON tmp.child=bec.[Beacon_Obj_Id]
END --- End SP

